# walking classification
def walkingClassification(dateStart, dateEnd, dfBaro):
    dates = pd.date_range(dateStart, dateEnd, freq='S')
    activityLog = pd.DataFrame(index=dates, columns=['activity'])
    activityLog['activity'] = ''
    previousActivity = ''
    for date in dates:
        if dfBaro.loc[date]['diff']  > 2.0:
            activityLog.loc[date]['activity'] = 'climbing'
        if dfBaro.loc[date]['diff'] < -2.0:
            activityLog.loc[date]['activity'] = 'down'

    lines = []
    executingActivity = False
    for (date, activity) in activityLog.iterrows():
        if activity[0] != '' and executingActivity == False:
            print "Starting %s at %s" % (activity[0], date)
            executingActivity = True
            lines.append(date)

        if activity[0] == '':
            if executingActivity == True:
                print "Ending at %s" % date
                lines.append(date)
            executingActivity = False

    return (activityLog, lines)

